export function extractData(expect) {
    if (expect) {
        return async (response) => {
            const res = await response;
            if (!res.ok) {
                throw new Error(`${expect} ${res.status} ${res.statusText} ${res.url}`);
            }
            else {
                return res.data;
            }
        };
    }
    else {
        return async (response) => {
            const res = await response;
            return res.data;
        };
    }
}
